  input: TEXT,F3XA,,"The Southern Nevada Chapter, NAIOP, Oregon Chapter, NAIOP and
    Georgians for Smart Growth are entities that act as collection units for the NAIOP-PAC.  The
    chapters held fundraisers for the PAC and collected funds of less than $40.00
    per person.  The funds were then combined on a chapter check and then deposited
    to the NAIOP-PAC.  I have corrected the YE filing by changing the three chapter
    receipts to unitemized.  Another adjustment was made regarding the memo item for
    $100.00.  I did enter the receipt for the $100.00 from McWhinney Hldg Co. but
    I was told by Rosa Lewis that since it was under $200.00 it did not show up on
    my report.  Therefore, only the memo item for the $100.00 check that was a contribution
    from Mr. Chad McWinney showed up on the filing report.  I amended this by itemizing
    the $100.00 receipt from McWhinney Hldg Co.  Please let me know if you have any
    questions regarding this amended filing. Stacy Maggard 703-674-1430.  Thank You."
